import os
import sys
from io import StringIO,BytesIO
from PyPDF2 import PdfFileReader


def isValidPDF_StringIO(content):
    bValid = True
    try:
        # PdfFileReader(open(pathfile, 'rb'))
        reader = PdfFileReader(StringIO(content))
        if reader.getNumPages() < 1:  # 进一步通过页数判断。
            bValid = False
    except Exception as e:
        print(e)
        bValid = False
        # print('*' + traceback.format_exc())

    return bValid

def isValidPDF_BytesIO(content):
    bValid = True
    try:
        reader = PdfFileReader(BytesIO(content))
        if reader.getNumPages() < 1:  # 进一步通过页数判断。
            bValid = False
    except:
        bValid = False

    return bValid

